import React from 'react'
import {Switch, Route} from 'react-router-dom'
import {Home} from "./components/Home/Home";

export const Routing = () => {
    return (
        <>
            <Switch>
                <Route exact path="/home">
                    <Home/>
                </Route>
                <Route exact path="">

                </Route>
            </Switch>
        </>
    )
}
